export interface ICDItem {
    kodu: string;
    adi: string;
}

export function normalizeText(text: string): string {
    return text
        .toLowerCase()
        .replace(/ı/g, 'i')
        .replace(/İ/g, 'i')
        .replace(/ö/g, 'o')
        .replace(/Ö/g, 'o')
        .replace(/ü/g, 'u')
        .replace(/Ü/g, 'u')
        .replace(/ç/g, 'c')
        .replace(/Ç/g, 'c')
        .replace(/ş/g, 's')
        .replace(/Ş/g, 's')
        .replace(/ğ/g, 'g')
        .replace(/Ğ/g, 'g')
        .trim();
}

export function searchStaticICD(query: string, limit: number = 20): ICDItem[] {
    const normalizedQuery = normalizeText(query);
    if (!normalizedQuery) return [];

    const searchTerms = normalizedQuery.split(/\s+/).filter(t => t.length > 0);
    const results: ICDItem[] = [];

    // First try to match by exact code
    for (const item of ICD_CODES) {
        if (normalizeText(item.kodu) === normalizedQuery) {
            results.push(item);
            if (results.length >= limit) return results;
        }
    }

    // Then try to match by partial code (starts with)
    for (const item of ICD_CODES) {
        if (results.some(r => r.kodu === item.kodu)) continue;
        if (normalizeText(item.kodu).startsWith(normalizedQuery)) {
            results.push(item);
            if (results.length >= limit) return results;
        }
    }

    // Finally try to match by name (all search terms must match)
    for (const item of ICD_CODES) {
        if (results.some(r => r.kodu === item.kodu)) continue;

        const normalizedAdi = normalizeText(item.adi);
        const allTermsMatch = searchTerms.every(term => normalizedAdi.includes(term));

        if (allTermsMatch) {
            results.push(item);
            if (results.length >= limit) break;
        }
    }

    return results;
}

/**
 * Lookup ICD code and return the diagnosis name.
 * If the input looks like an ICD code (e.g., A00, N40.1, etc.) and exists,
 * return the diagnosis name. Otherwise return the original value.
 */
export function lookupICDName(value: string): string {
    if (!value) return value;

    const upperVal = value.toUpperCase().trim();

    // ICD code pattern: letter followed by numbers, optionally with decimal
    const icdPattern = /^[A-Z]\d{2}(\.\d+)?$/;
    if (!icdPattern.test(upperVal)) {
        return value; // Not an ICD code format, return as-is
    }

    // Find exact match
    const match = ICD_CODES.find(item => item.kodu.toUpperCase() === upperVal);
    return match ? match.adi : value;
}

